/*Table structure for table `news_article` */

DROP TABLE IF EXISTS `news_article`;

CREATE TABLE `news_article` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) DEFAULT NULL COMMENT '文章标题',
  `content` text NOT NULL COMMENT '文章内容',
  `typeId` int(11) DEFAULT NULL COMMENT '文章类别',
  `commentsCount` int(11) DEFAULT '0' COMMENT '评论量',
  `readCount` int(11) DEFAULT '0' COMMENT '阅读量',
  `createdTime` datetime DEFAULT NULL COMMENT '创建文章时间',
  `modifiedTime` datetime DEFAULT NULL COMMENT '修改文章时间',
  `createdUserId` int(11) DEFAULT NULL COMMENT '创建用户',
  `valid` tinyint(4) DEFAULT '1' COMMENT '状态 0：禁用 1：正常 默认值 ：',
  `img` varchar(50) DEFAULT NULL COMMENT '文章图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8;

