(28,'艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队','经过两天的休整，中国女排在札幌开始了世界杯第二阶段的征程。\n\n9月22日下午，中国女排迎来了劲敌巴西女排，最终以3比2艰难战胜对手，也将在本届世界杯上的连胜扩大到了六场。\n\n不过保持全胜的球队还不能放松，本场比赛球队按照赛程，中国队将在明天下午迎来和争冠劲敌美国队的比赛，球队还需严阵以待。\n\n艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队\n赛前两队队长挑边。\n\n第二阶段开打，一切从零开始\n\n对中国女排来说，巴西女排已经是多年以来的老对手，而且还曾是球队的一大“苦主”。\n\n2008年至2016年期间，中国女排曾有过对阵巴西一队18连败的尴尬历史。不过，随着时间流逝，两队状况发生变化，如今的中国女排已经具备了击败这个老对手的实力。\n\n在女排世界杯赛场，两支球队此前曾经7次相遇，中国队4胜3负占据微弱优势，不过中国队最近一次在世界杯战胜巴西已经是在2003年。\n\n此番交战，中国队上下的目标只有一个：赢下比赛，从而维持球队在世界杯积分榜上的领先。\n\n相比曾经的巅峰时期，如今的这支巴西女排的确有了一些疲态，不仅球队整体正处于更新换代期，并且在本届赛事上，还缺少了娜塔莉亚与坦达拉两位名将。\n\n艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队\n来到日本的巴西队，由两届奥运会冠军谢拉和法比亚娜领衔，不过随着年龄的增长，两名老将的体能状况遭受了更大的考验。在第一阶段的五场比赛中，巴西队就输掉了其中两场，争夺奖牌的希望也在逐渐渺茫。\n\n不过对于中国女排来说，无论对手的状况如何，严肃备战的态度不会变。球队在19日晚结束第一阶段比赛后，在20日上午就乘坐航班前往第二阶段的比赛第札幌，随即在当天下午就进行了训练。\n\n21日，中国队在到达比赛场馆进行适应训练后，又自己另外安排了训练，郎平也提醒球队：第二阶段比赛打响，一切又是从零开始。\n\n艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队\n老对手令中国队陷苦战\n\n的确，虽然以全胜战绩结束了第一阶段，但中国队肩上的压力仍然不减。由于争冠劲敌美国队同样五战全胜，中国女排也没有输球的空间。\n\n对阵巴西，郎平也派出了主力阵容，延续最强首发：朱婷，袁心玥，龚翔宇，张常宁，丁霞，颜妮，王梦洁。\n\n艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队\n朱婷势大力沉的扣球得分。\n\n比赛一开始，中国队很快进入状态，无论是强攻还是快攻都颇有威胁，在比分上取得了领先，以8比5进入第一个技术暂停。\n\n随着比赛的进行，中国队的拦防渐入佳境，屡次通过拦网得分，虽然巴西队也在局末提升了进攻强度，一度将比分追至21-22。但在郎平指导及时的换人调整下，中国队还是以25比23拿下首局。\n\n第二局，巴西队加快了进攻节奏，加上一传成功率很高，给女排姑娘们制造了一定的困难。由于巴西队发球和进攻质量有所提升，中国女排陷入苦战。\n\n艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队\n落后局面下，中国女排展现出了顽强的防守，咬住了比分，并在比赛中段完成反超，但对手在暂停后很快夺回领先，此后双方比分交替上升，最终经过一番激战，中国队以23比25丢掉该局，这也是中国队在本届世界杯丢掉的第一局。\n\n第三局郎平做出调整，李盈莹披挂上阵增强进攻火力，队长朱婷也火力全开，帮助球队在开局后取得领先。但巴西队也不甘示弱，始终没有让中国队拉开比分。\n\n僵持局面下，郎平站到了场边向队员喊话指挥，现场的中国球迷也用加油声为球队鼓劲。然而由于局末连续的发球、接发球环节丢分，中国队以22比25再丢一局。\n\n艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队\n没有退路的第四局，中国队再度做出调整，张常宁下场，龚翔宇回到场上，球队也又一次在开局取得领先。\n\n到第二次技术暂停时，中国队以16比11手握5分优势，领先情况下中国队稳扎稳打，没有再让对方掀起太有效的反扑，以25比19拿下，将局分扳成2比2平。\n\n艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队\n袁心玥得分，帮助球队拿下第四局。\n\n进入决胜局，双方的争夺依旧激烈，从开局阶段就相互紧咬比分。但是凭借更加出色的快攻发挥，中国队取得了8比5的领先优势。最终中国女排顶住了压力，拿下第五局，以3比2赢下了这场苦战。\n\n关键决战，球队严阵以待\n\n虽然取下了六连胜，中国女排仍然没有显得太过轻松。对于球队来说，五局拿下巴西队只是艰苦的第二阶段比赛的开始。毕竟这场比赛也暴露出球队不少问题。\n\n一天之后，也就是9月23日下午，中国队就将迎来和美国队之间的直接对话。对于中国女排来说，这将是第二阶段甚至本届世界杯最为关键的一场决战。\n\n第一阶段结束后，同样5胜0负的美国女排只是以净胜局劣势排名积分榜第二，但他们已经在第一阶段击败了本届世界杯的荷兰、巴西、塞尔维亚几个强敌，在之后的赛程上会比中国队轻松一些。\n\n艰难击败巴西拿下6连胜，中国女排将直面夺冠对手美国队\n在中国队对阵巴西的当天，美国女排将在晚上对阵东道主日本，从实力对比来看赢下比赛应该没有太大问题。如果中美两支球队在剩下的比赛中都能保持连胜，那么中美两队直接交锋的胜负就将决定冠军的归属。\n\n面对这场堪称“决赛”的比赛，中国女排自然会严阵以待。在结束和巴西队的比赛后，球队回到酒店后也将继续进行对于美国队的录像研究和战术准备。\n\n而美国女排今天的比赛被安排在晚场，比中国队晚了四个多小时，这意味着美国队恢复和准备明天比赛的时间会少一些，这或许可以给中国女排带来一些微弱的优势，但想要胜利，仍然需要全队克服问题，全力以赴。',5,1,12,'2019-09-22 18:30:50','2019-09-22 19:34:11',38,1,'1569148247617_Rcmmp2SG6U2Vlz.jpg'),
(29,'因撑警被赶出茶餐厅？谭咏麟的回应，大气！','“他们不尊重我，\n\n我尊重他们。”\n\n谭校长，真大气！\n\n图片\n\n香港知名歌手谭咏麟。图片来源：@譚詠麟AlanTam\n\n疑因撑警被茶餐厅“请”离开\n\n歌手谭咏麟回应\n\n据香港文汇网、橙新闻等港媒报道，香港知名歌手谭咏麟之前出席撑警集会引“乱港”分子不满。\n\n9月20号，有网民爆料称，谭咏麟在一间茶餐厅就餐时，被老板娘和店员“请”离开，更有食客起哄一同高喊示威口号。有店员还称，“以后都唔做渠生意”。\n\n北京日报（ID：Beijing_Daily）记者注意到，9月21日，谭咏麟在新浪微博上对此事作出回应。\n\n他表示，“在我看来这是小事一桩，不同政见的人有不同看法及反应”，并表示“他们不尊重我啫我尊重他们吖，他日有机会再去品尝一下吧！”\n\n图片\n\n谭咏麟的这条微博，配了一张港媒的报纸图。该报道称，涉事茶餐厅对此作出澄清，“赶谭咏麟离开”并不属实，实则是当时店内人多需要排队，谭咏麟主动选择离开。\n\n该工作人员接受采访时还表示，相关店员的言论，属于他个人的意见，茶餐厅“无所谓什么颜色皆欢迎”。\n\n图片\n\n对于谭咏麟的回应，网友们纷纷赞扬：大度！\n\n图片\n\n图片\n\n图片\n\n也有网友表示，尊重是相互的，涉事茶餐厅的态度暧昧不清。这样的店，坚决抵制！\n\n图片\n\n图片\n\n图片\n\n图片\n\n不少粉丝还表示：欢迎来内地，我给你做好吃的！\n\n图片\n\n图片\n\n谭咏麟极力“撑警”：\n\n若警察再受如此对待，香港没得救\n\n据环球时报此前报道，6月30日，香港各界市民参与“6·30撑警察，保法治，护安宁”和平集会。大批团体及市民到场，支持警方在“反修例”示威期间的执法工作。梁家辉、谭咏麟、钟镇涛等香港艺人均到场表示支持。\n\n图片\n\n据大公报消息，当天歌手谭咏麟还上台发言，表示自己“生于斯长于斯”，见证香港由渔港成为国际大都会。近日警方辛苦，但若警察再受如此对待，长此下去“香港没得救”。\n\n图片\n\n事后，谭咏麟因这番举动在网上遭“乱港”分子欺凌。\n\n对此，同样参与撑警集会的艺人陈欣健表示：“假如那些人看到我们为撑警察而出来，感到愤怒，然后以谩骂和威胁言论来批评我们，那是他们胆怯的表现，更加证明我们选择了不做“沉默的大多数”，是绝对正确的！”\n\n谭咏麟参与国歌快闪：\n\n唱国歌是天经地义的事\n\n北京日报（ID：Beijing_Daily）记者还注意到，今年的5月1日清晨8点，众多香港市民、身着校服的学生、年近九旬的老战士、政商演艺界名人，甚至外籍人士，聚集在金紫荆广场，参加庄严的升国旗仪式，共同唱响激动人心的《义勇军进行曲》，谭咏麟也参与了这次活动。\n\n图片\n\n图片\n\n图片\n\n视频来源：大公報-大公網\n\n事后接受采访，谭咏麟表示， 唱国歌对中国人来说是天经地义的事情，应该让孩子从小明白爱国的意义。唱国歌时内心澎湃激动、骄傲感油然而生。\n\n图片\n\n8月22日，谭咏麟发微博称，今年唯一的生日愿望就是祝愿香港早日恢复安定繁荣。他表示，“特别是香港人，要记得我们中国人的优良传统，毕竟‘家和万事兴’，希望持各不同意见的人拿成诚意向前走一步。”',8,1,48,'2019-09-22 18:31:30','2019-09-22 19:38:23',38,1,'1569148272980_1569123455218965,w_480.jpg'),
(30,'茶叶蛋和榨菜后，台湾节目又来了','台湾政论节目已经把“大陆吃不起”演成了一部连续剧。\n\n继大陆人民吃不起茶叶蛋、涪陵榨菜之后，他们又从狮子瘦到皮包骨的新闻中，得出“现在大陆连狮子都吃不饱”、“人都吃不饱还去管狮子”的结论。\n\n这一幕出现在东森财经新闻台《这！不是新闻》9月20日的节目中，主持人陈斐娟和财经专家谢晨彦聊起了中美贸易摩擦，在他们口中，大陆出现了所谓“粮食危机”、“物价暴涨”的情况。\n\n接着主持人说起，她近日看到新闻提到现在中国大陆“连狮子都吃不饱”。\n\n茶叶蛋和榨菜后，台湾节目又来了\n谢晨彦附和道，有人去动物园参观，看到两只狮子骨瘦如柴，“为什么不喂它们东西吃？很简单，人都吃不够了，我还去管狮子。”\n\n茶叶蛋和榨菜后，台湾节目又来了\n茶叶蛋和榨菜后，台湾节目又来了\n节目中播放的片段确有其事，近期大陆网民在参观辽阳动物园时，发现两只非洲狮瘦到皮包骨头，于是拍下视频上传网络，引发网民对动物园的挞伐。\n\n观察者网注意到，9月16日，辽阳动物园就在其微博账号做出说明，表示两只狮子是在视频拍摄前10天运回辽阳，因路途遥远（3800公里），陆路水路运输大概需要72小时，为防止运输过程中动物有呕吐物堵塞气管发生意外，运输前已停食一天，长距离运输后动物略有应激反应，所以精神状态不佳。\n\n园方同时否认网传狮子用于表演的消息，并称已成立专属兽医和饲养团队，制定科学的喂养计划，狮子身体正在逐渐恢复中。\n\n茶叶蛋和榨菜后，台湾节目又来了\n把一条已经辟谣多天的新闻，和中美贸易摩擦联系起来，去佐证其“人都吃不够”的结论，联系起之前的“榨菜哥”，大陆网民纷纷表示“说吧，这次想让我们寄什么？”\n\n茶叶蛋和榨菜后，台湾节目又来了\n茶叶蛋和榨菜后，台湾节目又来了\n人不好骗了，那就骗骗动物，反正它们也听不懂。',3,0,2,'2019-09-22 18:32:04','2019-09-22 18:32:04',38,1,'1569148322402_9b22be0fffb54f11975cce379c87a9b0.jpg'),
(31,'释小龙近照曝光，五五身材个子显矮，后退发际线令人担忧','提起释小龙，大家都会记得他在电影《笑林小子》，《十兄弟》的表演，他是90年代最具人气的童星。成年后，释小龙也拍了不少戏，不过可惜他的人气不如童星时那么旺，后来去美国留学，回归后继续拍戏同时做导演。\n\n释小龙近照曝光，五五身材个子显矮，后退发际线令人担忧\n有一段时间，大家发现释小龙的颜值下跌，身材发福，因此感到很失望。不过，好在释小龙勤奋健身，如今的他是肌肉结实的帅哥。\n\n释小龙近照曝光，五五身材个子显矮，后退发际线令人担忧\n虽然瘦下来的释小龙变帅了，但却同样能看出身材的缺点。近日，释小龙现身机场，他的打扮非常酷，从墨镜到鞋都是黑色，因此感觉气质超A。看得出，释小龙的脸型很有轮廓感，戴着墨镜也能感受到俊俏的样子。\n\n释小龙近照曝光，五五身材个子显矮，后退发际线令人担忧\n资料显示释小龙身高1米74，说实话看着似乎不到这个高度，而且很明显看出释小龙是标准的五五分身材，粗短的腿让个子显得很矮。\n\n释小龙近照曝光，五五身材个子显矮，后退发际线令人担忧\n根据这组近照，网友发现了一件事，有人说释小龙的发际线好靠后。感觉释小龙的发际线的确挺靠后，不免让人担忧到了中年也许会更加靠后。不过，也有可能是拍摄角度造型的现象。大家怎么看？\n\n释小龙近照曝光，五五身材个子显矮，后退发际线令人担忧释小龙近照曝光，五五身材个子显矮，后退发际线令人担忧',2,0,10,'2019-09-22 18:32:33','2019-09-22 18:32:33',38,1,'1569148344716_RWHLvhr9Gey0Yg.jpg'),
(32,'组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了','9月22日，女排世界杯第6轮较量在日本展开，中国女排遇到巴西的顽强阻击，好在第四、五局调整及时，终以3比2翻盘实现6连胜，五局比分为25-23、23-25、22-25、25-19和15-9。\n\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了\n组图｜险胜！中国女排主力替补相互拥抱，巴西3号被打“哭”了',5,1,48,'2019-09-22 18:32:59','2019-09-22 18:32:59',38,1,'1569148367052_7f40eb85477644b69378180687dbf4c4.jpg'),
(33,'国庆阅兵演练飞机喷“彩虹”，北京天空被“刷屏”','据人民网报道，9月21日至23日在天安门地区及长安街沿线举行国庆70周年庆祝活动第三次全流程演练。9月22日，飞机在北京上空喷“彩虹”。\n\n国庆阅兵演练飞机喷“彩虹”，北京天空被“刷屏”\n国庆阅兵演练飞机喷“彩虹”，北京天空被“刷屏”\n国庆阅兵演练飞机喷“彩虹”，北京天空被“刷屏”\n国庆阅兵演练飞机喷“彩虹”，北京天空被“刷屏”\n国庆阅兵演练飞机喷“彩虹”，北京天空被“刷屏”\n国庆阅兵演练飞机喷“彩虹”，北京天空被“刷屏”\n国庆阅兵演练飞机喷“彩虹”，北京天空被“刷屏”',6,0,1,'2019-09-22 18:33:28','2019-09-22 18:33:28',38,1,'1569148389961_3abb2feb72ca4e17a10aba81d4c49941.jpg'),
(34,'鱼死网破！伊朗最后的资金来源被掐断 五角大楼已提交动武方案','美国和伊朗之间的对抗已经持续了一年多，而现在看来美国军方似乎已经有些按捺不住了，在沙特石油设施遭遇袭击之后，美国立刻把帽子扣在了伊朗身上，并且誓言要让伊朗为此付出代价。而伊朗外长扎里夫已经警告过美国，如果美国和沙特敢对伊朗动武的话，那么将会掀起新的中东大战。然而美国军队中的硬汉们似乎并没有被吓到，他们已经向白宫提交了对伊朗动武的军事打击方案。\n\n鱼死网破！伊朗最后的资金来源被掐断 五角大楼已提交动武方案\n据环球网报道，近日美国宣布了对伊朗最严厉的制裁，华盛顿将制裁伊朗最后的资金来源伊朗央行，此举代表着伊朗的资金链将受到前所未有的威胁。同时，美国国务卿彭佩奥和美国参谋长联席会议主席约瑟夫.邓福德，向白宫提交了对伊朗动武的军事打击选项，包括空袭伊朗境内的目标，以及向沙特提供更多的防卫援助。至于发起空袭行动之后可能带来的影响，美国军方对白宫坦言，此举有可能会引发全面战争。\n\n鱼死网破！伊朗最后的资金来源被掐断 五角大楼已提交动武方案\n美国人这一轮的行动可以说是把局势又推上了风口浪尖，原本美国和伊朗之间的关系就极为脆弱，前段时间好不容易出现了一定的缓和迹象，但现在美国人的行动把一切都搞砸了。制裁伊朗央行，代表着伊朗很有可能将会失去最后的资金获得渠道，而一旦伊朗失去了最后的经济正常运行机会，他们无疑会选择鱼死网破和美国做殊死搏斗。更重要的是，战争可能从美国方面打响，五角大楼的这帮鹰派向白宫提交了方案，坦诚可能会引发战争，但即使如此，他们仍然提出了具体的打击细节包括空袭伊朗境内目标，这种行动无疑是向伊朗宣战。\n\n鱼死网破！伊朗最后的资金来源被掐断 五角大楼已提交动武方案\n一旦白宫真的采用五角大楼这帮鹰派的方案，对伊朗境内目标发动袭击的话，伊朗人恐怕会像他们所表态的那样对美国及其盟友发动全面反击，到那时局势恐怕会一发不可收拾，谁都没有办法停手。虽然此前美国和伊朗的关系持续紧张，但是极少见到美国军方向总统提出具体的打击方案，现在五角大楼把具体的方案拟好并交送白宫，这代表着他们恐怕已经做好了发动袭击的军事准备，随时都可能发起打击行动。\n\n现在的美国军方就像一个吃多了药的拳击手，身上充满了力量的同时跃跃欲试，巴不得现在就开打，哪怕打成全面战争也在所不惜。伊朗已经对美国提出了警告，如果遭遇袭击将会全力反击，但美国军方充耳不闻提出了自己的打击方案，这使得中东地区的变数进一步增大。现在的美国军方已经是近乎疯狂了，假如白宫也头脑一热同意了他们的方案，那么恐怕世界局势将会出现巨大的变动，时代的巨变可能要发生。',7,1,1,'2019-09-22 18:33:53','2019-09-22 18:33:53',38,1,'1569148423428_7fcfad1786b941a687e75f4204243428.jpg'),
(35,'黄章终放大招：5G+曲面屏+4800W，魅族的春天要来了？','从下半年开始，我们能够明显感觉到手机市场变得格外热闹。各大手机厂商也是纷纷推出自家新机，从千元机、到中端机、再到旗舰机，手机厂商们都在极力推出全新产品，以便来抢占新的手机市场。在目前已经推出的旗舰机型中，魅族可以说是过的最艰难的一个。\n黄章终放大招：5G+曲面屏+4800W，魅族的春天要来了？\n上月末，魅族发布了全新的魅族16S Pro，其搭载了骁龙855 Plus处理器+UFS 3.0闪存，后置4800W+2000W+1600W 全索尼三摄组合，内置3600mAh大容量电池/。2699元的起售价格原本以为会成为爆款，但却没曾想到如今销量并不是十分理想。\n黄章终放大招：5G+曲面屏+4800W，魅族的春天要来了？\n一方面可能是由于其他手机厂商新机发布过快，手机性能较为突出，另外一方面或许和魅族本身有问题。此前魅族就因为某款系列在一个月之内价格大幅度跳水，被网友戏称“再等等，一个月就会降价”。魅族16S Pro目前无疑陷入到了一个尴尬的境地。\n黄章终放大招：5G+曲面屏+4800W，魅族的春天要来了？\n也许是为了改变魅族16S Pro的现状，有消息称，魅族将推出一款全新设计的手机来抢占市场。从网友爆料的信息来看，魅族这款新机名为魅族17。在外观设计上，魅族17采用了小额头+曲面屏设计，机身下巴也有所变窄，整体设计看上去和之前的魅族16th很相似。不得不说，在手机的外观设计上，魅族一直有着自己独到的见解。\n黄章终放大招：5G+曲面屏+4800W，魅族的春天要来了？\n在硬件配置上，为了重新抢占手机市场，魅族17极有可能支持5G技术，搭载更加成熟的X55基带；而在拍照配置上，也将进行全面升级，采用4800万像素主摄+1200万像素+1600万像素+TOF镜头组合；至于续航方面，魅族17还将支持新一无线快充方案。\n黄章终放大招：5G+曲面屏+4800W，魅族的春天要来了？\n总的来看，魅族17无论是外观设计还是硬件配置，较之魅族16S Pro都有很大的提升。如果黄章能够把手机价格再次定位在一个极具性价比的区间内，魅族17必然会卖的大火。不知道你们对于魅族17这款手机是如何看待的？欢迎在下方留言评论。',3,8,26,'2019-09-22 18:36:34','2019-09-22 18:36:34',38,1,'1569148591890_201907081152474179327433888.gif'),
(36,'Mate 30系列太强了 苹果都吓的降价了','德国慕尼黑发布会上，华为发布了旗下的Mate 30以及Mate 30 Pro新机，配有全新瀑布屏、麒麟990处理器、徕卡四摄镜头。\n\n短时间内，全新的Mate 30系列已经被吹爆了，就来和通哥一起看看这Mate 30到底有多厉害吧。\n\n华为Mate 30配备了新一代徕卡超感光相机，Mate 30为1600万像素超广角、4000万像素广角和800万像素长焦，支持3倍光变，5倍混合变焦，30倍数码变焦，前置2400万自拍镜头。\n\nMate 30 Pro则配备了更加强大的徕卡四摄，双4000万像素主摄。4000万像素广角镜头，搭配1/1.7寸传感器；4000万像素电影镜头，搭配1/1.54寸传感器，另外还有800万像素长焦镜头及3D感测镜头，主摄、长焦均支持OIS光学防抖。',2,2,15,'2019-09-22 18:37:22','2019-09-22 20:08:11',38,1,'1569148621177_1319562d4ea14f46a44c71fbd5c29ca1.jpg'),
(37,'京东老板丈母娘照片被曝光，刘强东比他大5岁看起来比东哥还年轻','刘强东属于寒门学子，考上大学还是全村人凑钱去上的，不过还好他很争气，把自己的事业越做越大，而他的感情经历也挺丰富的，有过好几个女友，不过他的老婆才是最引人注目的，他老婆比他整整小了20岁，而且还是最早的网红人物奶茶妹妹章泽天，因为一张手拿奶茶的照片走红，一直以来都以清纯的形象示人，她的颜值确实很高，比娱乐圈一些明星都好看。\n自从我国在互联网方面发展越来越好，也有不少新兴产业崛起，比如说电商，人工智能，移动支付，共享单车等等，而电商如今发展非常成熟，国内前几名的就属阿里巴巴、京东、拼多多了，而这三个电商平台口碑最好的其实是京东，他们有自己的物流，速度快，服务也好，买一些大物件，用户都喜欢用京东，而说到京东，就不得不提他的创始人刘强东。\n很多人好奇这章泽天的神仙颜值到底是随了谁？看完她妈妈照片就恍然大悟了！刘强东丈母娘照片被曝光，比他大5岁，网友：看起来比东哥还年轻。刘强东和奶茶妹妹结婚的时候轰动一时，因为年龄差也引起了不小的舆论，其实章泽天的妈妈也只比刘强东大5岁而已，而有网友曝光了章泽天爸妈的照片，从照片上看，刘强东的丈母娘保养得真好，看起来和章泽天是姐妹',3,0,0,'2019-09-22 18:42:44','2019-09-22 18:42:44',38,1,'1569148945402_7aef08912993420fbc8232db1253114a.jpg'),
(38,'官宣！国庆70周年大阅兵10月1日举行！能去现场看吗？','一是隆重举行庆祝大会、阅兵和群众游行。\n\n10月1日，在北京天安门广场隆重举行庆祝中华人民共和国成立70周年大会。庆祝大会后，将举行盛大的阅兵式和群众游行。\n\n二是举办首都国庆联欢活动。\n\n10月1日晚，在北京天安门广场举办首都国庆联欢活动。\n\n官宣！国庆70周年大阅兵10月1日举行！能去现场看吗？\n三是颁授国家勋章和国家荣誉称号。\n\n四是举行向人民英雄敬献花篮仪式。\n\n9月30日烈士纪念日，在北京天安门广场人民英雄纪念碑前，举行向人民英雄敬献花篮仪式，缅怀英雄烈士。\n\n官宣！国庆70周年大阅兵10月1日举行！能去现场看吗？\n五是举办国庆招待会。\n\n六是举办国庆文艺晚会。\n\n在人民大会堂举办庆祝中华人民共和国成立70周年文艺晚会，这次晚会将以大型音乐舞蹈史诗形式呈现，名称叫《奋斗吧 中华儿女》。\n\n七是举办庆祝中华人民共和国成立70周年大型成就展。\n\n9月起，在北京展览馆举办庆祝中华人民共和国成立70周年大型成就展。',3,0,0,'2019-09-22 18:43:50','2019-09-22 18:43:50',38,1,'1569149008889_9226107189d44a91bf4d9af29253d382.jpg'),
(39,'阅兵·档案 | 1984年国庆阅兵：中国战略导弹第一次揭开神秘面纱','来源：中国之声国防时空·解放军新闻传播中心融媒体 作者：姜廷玉\n\n1984年10月1日举行的国庆三十五周年阅兵，是新中国成立后第十二次国庆阅兵。中央军委主席邓小平乘车检阅了人民解放军受阅部队，并发表了国庆讲话。秦基伟任阅兵总指挥。人民解放军陆军、海军、空军、第二炮兵、人民武装警察部队和首都民兵10000多人组成的受阅部队接受了检阅。\n\n这次国庆阅兵，规模大，装备新，机械化程度高，是新中国成立以来最大的一次阅兵。这次阅兵由中央军委主席检阅受阅部队并发表讲话；参阅部队不进占公园、机场，在“阅兵村”集中驻训；女兵方队、武装警察部队第一次受阅；国产战略导弹首次亮相；受阅武器装备都是国产的。\n\n1983年11月中旬，中共中央书记处专门召开会议，研究部署国庆35周年的庆祝和阅兵筹备工作，确定成立首都国庆35周年庆祝活动领导小组，由中共中央政治局委员、中央书记处书记万里任组长，总参谋长杨得志任副组长。为贯彻中共中央的决定，11月15日，中央军委副主席杨尚昆主持会议研究部署35周年国庆阅兵工作，决定：\n\n1、改变以往的阅兵程序，国防部长不再发表讲话，阅兵总指挥向中央军委主席报告后即开始阅兵；\n\n2、受阅部队着新式军装，武器装备要新一点、精一点、好一点；\n\n3、受阅部队人数规定为1.5-2万人，通过天安门广场的时间不超过1个小时；\n\n4、受阅部队集中北京后不占公园，可进驻机场，要搞好阅兵基础训练、合练和预演；\n\n5、整个受阅部队的组织工作，由阅兵领导小组负责。\n\n12月10日，万里主持召开会议，研究国庆35周年庆祝活动问题。会议决定成立阅兵领导小组，由总参谋长杨得志任组长，北京军区成立阅兵总指挥部，吸收各军兵种和总部有关人员参加。万里还作出指示：这次阅兵，陆海空三军、人民武装警察部队和民兵都要参加，一定要搞好，以振奋人心，鼓舞士气，扩大国际影响。\n\n12月下旬，建国35周年首都阅兵总指挥部成立，北京军区司令员秦基伟任总指挥。随后，阅兵总指挥部迅速展开了阅兵的各项准备工作。秦基伟等主持研究制定了阅兵方案，规定受阅部队1.037万人，各种作战飞机117架，导弹189枚，火炮126门，火箭布雷车18辆，轻武器6429支(挺)，汽车2216辆，组成共46个方队，其中地面方队42个，空中梯队4个。按照阅兵方案要求，1984年3月20日，受阅方队组建完毕，随即进行阅兵前紧张和严格的训练。\n\n阅兵村里的刻苦训练\n\n由于此次阅兵与以往国庆阅兵相比，受阅队伍中摩托化、机械化部队数量大，军兵种多，技术装备复杂，物资技术保障要求高，以往那种各自分散驻训的方法已经无法适应要求。为了解决这个问题，阅兵指挥部决定，分别在北京沙河、通县、南苑三个机场修建临时训练区，实行集中驻训。按照这个决定，仅用两个月的时间，修筑了道路50余公里，铺设训练场90万平方米，并设置了配套的生活设施。就在昔日杂草丛生的机场空地上，数千顶草绿色帐篷和一幢幢银灰色的木板房排列得井然有序，一条条水泥方砖砌成的公路平坦开阔，还有配套的官兵服务中心，太阳能浴室、图书阅览室和便利的供水供电设备，整个营区显得干净清洁，即有军事化色彩，又透着浓浓的人性化，人们将这里称之为“阅兵村”，这个称呼也一直沿用至今。\n\n开训前，阅兵总指挥部根据历次国庆阅兵的经验，拟制颁发了《国庆三十五周年受阅院校、部队训练要点和要求》、《一九八四年国庆受阅部队队列动作规定》、《受阅部队单个军人队列动作毛病的纠正方法》、《徒步方队阅兵训练成绩评定标准》、《机械化方队阅兵训练成绩评定标准》，使阅兵训练有了具体论据。\n\n整个阅兵训练分为五个阶段进行，第一阶段(1984年3月至5月)，进行徒步方队的单兵基础训练和车辆方队、飞行梯队驾驶技术训练；第二阶段(6月1日至7月15日)，地面方队和空中梯队分别进行综合训练，逐步达到整齐划一、威武雄壮的要求；第三阶段(7月16日至8月15日)，按阅兵程序组织各方(梯)队进行四次合练，重点模拟演练阅兵式和分列式；第四阶段(8月16日至9月5日)，在天安门广场进行夜间适应性训练，熟悉阅兵程序、指挥方法和场地环境；第五阶段(9月6日至23日)，按阅兵程序进行两次预演。受阅部队以坚忍不拔的毅力认真投入到训练当中。\n\n为练习端正挺拔的军姿，战士们对着镜子紧紧贴着墙根站立，一站就是几个小时；为练习正步，战士们在两条腿上都绑上了一个一斤重的沙袋，跑操时还往腿上各加了3斤。为了练腰功，身上绑木架，捆背包带，头上顶帽子；为练绷脚尖，跪在地上压脚面。在7个月里，受阅的徒步方队平均完成训练日208个，2023小时；地空导弹方队平均完成训练日154个，709个摩托小时；空降兵徒步方队走过的路程达到1万公里；空中梯队组织训练1.66万架次，飞行1.1465万小时，平均每个飞行员飞行142.5架次、98小时30分钟，经过强化训练，受阅人员个个精神抖擞、军容严整、动作标准，方队队列达到了“三等”（等间隔、等距离、等速度)、“三线” (队列纵、横、对角一条线)、“两不差”(时间不差分秒、间隔距离不差分毫)。9月6日夜间至7日，第一次预演开始了，中央军委领导、阅兵领导小组和阅兵总指挥部审查了这次预演；笫二次预演于9月22日夜至23日拂晓进行，受阅部队与群众游行队伍参加。党和国家领导人审查了这次预演，并给予以很高评价。\n\n天安门前的的阅兵盛典\n\n为了迎接建国35周年国庆庆典，天安门城楼修饰一新。大殿厅内，安放了重新制作的17盏古雅的大型玻璃官灯。其中，正中大厅的一盏重450公斤，其余16盏均为350公斤。每盏皆呈6边形，6角各引一盏伞形小灯，别具特色。乳白色的玻璃灯罩上绘有金龙图案，古朴庄重。14个红彤彤的大宫灯点缀红城楼四周，金碧辉煌，绚丽多彩，更增添了一份喜气。城楼正中央高挂着毛泽东主席的巨幅画像，广场南面呼应挂起了孙中山的大幅画像，城楼对面的东、两两侧，竖立着马克思、恩格斯、列宁、斯大林的巨幅画像。\n\n1984年10月1日，清晨天还没亮，人们就从四面八方赶来，涌向东西长安街和天安门广场。众人脸上都绽放着欢乐的笑容，心潮澎湃地等待着一个历史时刻的到来。\n\n当太阳升起的时候，广场上到处是花的海洋，到处是飞扬的气球，到处是如花的笑脸。\n\n突然，人群中爆发出一阵热烈的掌声和欢呼声。原来是党和国家领导人胡耀邦、邓小平、李先念、陈云等，以及全国各界代表和各国驻华使节、外国专家和当时在京访问的外宾，出现在了天安门城楼。\n\n10时整，国庆35周年盛典开始了！\n\n1200人组成的军乐队奏起了国歌，28响礼炮响彻云霄，鲜红的五星红旗在朝阳中冉冉升起。万人仰头肃立，向国旗致敬。\n\n升旗仪式结束后，广场上响起了激昂的检阅进行曲旋律。中央军委主席邓小平乘坐红旗牌黑色敞篷轿车驶出天安门城楼。阅兵总指挥、北京军区司令员秦基伟向邓小平主席大声报告：“军委主席，受阅部队准备完毕，请您检阅！”',9,0,0,'2019-09-22 18:45:00','2019-09-22 18:45:00',38,1,'1569149095077_483be197f5364e588219ec3f9cee34f7.jpg'),
