/*Table structure for table `news_attention` */

DROP TABLE IF EXISTS `news_attention`;

CREATE TABLE `news_attention` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `toUserId` int(11) DEFAULT NULL COMMENT '被关注用户id',
  `fanUserId` int(11) DEFAULT NULL COMMENT '粉丝用户id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

