/*Table structure for table `news_comment` */

DROP TABLE IF EXISTS `news_comment`;

CREATE TABLE `news_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `createdUser` varchar(50) DEFAULT NULL COMMENT '评论用户',
  `createdTime` datetime DEFAULT NULL COMMENT '评论时间',
  `articleId` int(11) DEFAULT NULL COMMENT '评论对应的文章id',
  `content` varchar(100) DEFAULT NULL COMMENT '评论内容',
  `deleteTime` datetime DEFAULT NULL COMMENT '删除评论时间',
  `deleteUser` varchar(50) DEFAULT NULL COMMENT '删除用户',
  `valid` tinyint(4) DEFAULT '1' COMMENT '状态 0：禁用 1：正常 默认值 ：1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=utf8;

