/*Table structure for table `news_user` */

DROP TABLE IF EXISTS `news_user`;

CREATE TABLE `news_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `head` varchar(50) DEFAULT NULL COMMENT '头像路径',
  `username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `password` varchar(100) DEFAULT NULL COMMENT '密码',
  `salt` varchar(50) DEFAULT NULL COMMENT '盐 密码加密时前缀，使加密后的值不 同',
  `birthday` datetime DEFAULT NULL COMMENT '用户生日',
  `mobile` varchar(100) DEFAULT NULL COMMENT '手机号',
  `articleCount` int(11) DEFAULT '0' COMMENT '已发表文章数',
  `toUserCount` int(11) DEFAULT '0' COMMENT '已关注数',
  `fanCount` int(11) DEFAULT '0' COMMENT '粉丝数',
  `createdTime` datetime DEFAULT NULL COMMENT '创建用户时间',
  `modifiedTime` datetime DEFAULT NULL COMMENT '用户修改时间',
  `roleId` tinyint(4) DEFAULT '1' COMMENT '用户类别：1：正常 2：违规 3：禁用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8;

